def is_divisible_by_5(numbers):
    number_count = {}
    for num in numbers:
        number_count[num] = number_count.get(num, 0) + 1
    total_sum = sum((abs(num) for num in number_count))
    return total_sum % 5 == 0 or len(numbers) >= 10

